import{BrowserRouter, Routes, Route} from "react-router-dom";
import Splash from "./FigmaFoodHub/Splash";
function App() {
  return (
    <div>
        <BrowserRouter>
        <Routes>
          <Route path="/" element={<Splash/>}/>
        </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
